import React from 'react';
import Tilt from 'react-parallax-tilt';
import brain from './brain.png'
import './Logo.css'

const Logo = () => {
    return(
        <div className='na4 mt4'>
            <Tilt  className="parallax-effect-img" tiltMaxAngleX={40} tiltMaxAngleY={40} perspective={800} transitionSpeed={1500} cale={1.1}gyroscope={true} style={{margin: '50px'}}>
            <div className='Tilt br2 shadow-2' style={{ width:'100px',height: '100px', backgroundColor: 'darkgreen' }}>
                <div className='Tilt0inner pa3'><img style={{paddingTop: '5px'}}alt='brain logo' src={brain} /></div>
            </div>
            </Tilt>
        </div>
    )
}

export default Logo
